import React from "react";
import { useParams } from "react-router";

const ProjectDetails = () => {
  const { id } = useParams();
  return (
    <div>
      <h1>Project Details</h1>
      <h2>{id}</h2>
    </div>
  );
};

export default ProjectDetails;
